import React from "react";

const toolbar = (props) => {
  return (
    <header>
      <div className="title-area">
        <h3>{props.title}</h3>
      </div>
      <div className="user-area">
        <a>
          <i class="far fa-bell"></i>
          <span>2</span>
        </a>
        <a>
          <div className="user-image"></div>
          <i class="fas fa-caret-down"></i>
        </a>
      </div>
    </header>
  );
};
